import React, { Component } from 'react';

class Travel extends Component {
    render() {
        return (
            <div className="contbox">
                <div className="travelimg"></div>
                <h1>세계대탐방그룹</h1>
                <p>
                    열심히 일한 당신, 떠나라.
                    열심히 노는 당신, 당신도 떠나라.
                </p>
            </div>
        );
    }
}

export default Travel;
